import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const DisplayItems = ({ items }) => {
  const [selectedCategory, setSelectedCategory] = useState('');
  const [filteredItems, setFilteredItems] = useState([]);
  const navigate = useNavigate();  

  const handleCategoryChange = (event) => {
    const category = event.target.value;
    setSelectedCategory(category);
    setFilteredItems(items.filter(item => item.category === category));
  };

  return (
    <div className="inventory-items">
      <h2>{selectedCategory ? `Items in ${selectedCategory}` : 'All Inventory Items'}</h2>
      {selectedCategory ? (
        <div className="category-select-container">
          <label htmlFor="category">Select Category:</label>
          <select id="category" value={selectedCategory} onChange={handleCategoryChange}>
            <option value="">--Select a Category--</option>
            <option value="Clothing">Clothing</option>
            <option value="Electronics">Electronics</option>
            <option value="Entertainment">Entertainment</option>
          </select>
        </div>
      ) : null}

      {filteredItems.length > 0 ? (
        <table className="item-details-table">
          <thead>
            <tr>
              <th>ID</th>
              <th>Name</th>
              <th>Quantity</th>
              <th>Price</th>
              {selectedCategory ? null : <th>Category</th>}
            </tr>
          </thead>
          <tbody>
            {filteredItems.map((item) => (
              <tr key={item.id}>
                <td>{item.id}</td>
                <td>{item.name}</td>
                <td>{item.quantity}</td>
                <td>{item.price}</td>
                {selectedCategory ? null : <td>{item.category}</td>}
              </tr>
            ))}
          </tbody>
        </table>
      ) : selectedCategory ? (
        <p>No items found in the selected category.</p>
      ) : (
        items.length > 0 ? (
          <table className="item-details-table">
            <thead>
              <tr>
                <th>ID</th>
                <th>Name</th>
                <th>Quantity</th>
                <th>Price</th>
                <th>Category</th>
              </tr>
            </thead>
            <tbody>
              {items.map((item) => (
                <tr key={item.id}>
                  <td>{item.id}</td>
                  <td>{item.name}</td>
                  <td>{item.quantity}</td>
                  <td>{item.price}</td>
                  <td>{item.category}</td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>No items in inventory.</p>
        )
      )}
      <div className="button-container">
        <button className="dashbutton" onClick={() => navigate('/')}>Back to Dashboard</button>
      </div>
    </div>
  );
};

export default DisplayItems;
